    <p><img alt={"img"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./../../static/img/caramelo-200-reais.jpeg").default} /></p>
    <p>{`Vira-lata Caramelo. Ele é a cara do Brasil. Esteja você onde estiver,
não importa a sua classe social, seu endereço ou sua região, é certo que
no seu bairro, provavelmente na sua rua, há um simpático cãozinho da cor
caramelo vagando atrás de água, comida ou diversão. Que caricatura! 🐕`}</p>
    <h2 {...{
      "id": "detalhamento"
    }}>{`Detalhamento`}</h2>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`id`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`nome`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`intervalo`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Sprint-12`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Vira-lata Caramelo`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`07 a 18 de Setembro de 2020`}</td>
        </tr>
      </tbody>
    </table>
    <h2 {...{
      "id": "time"
    }}>{`Time`}</h2>
    <p>{`Augusto, Luís, Marcelo, Nitai, Renê, Vitor, Washington.`}</p>
    <h2 {...{
      "id": "histórias"
    }}>{`Histórias`}</h2>
    <ol>
      <li parentName="ol"><del parentName="li">{`[Painel de atendimento]`}{` Incluir campo novo (avaliação de atendimento) - 1ª semana`}</del></li>
      <li parentName="ol"><del parentName="li">{`Implementar conjunto de melhorias de interface do Raio-x`}</del><blockquote parentName="li">
          <p parentName="blockquote"><em parentName="p">{`Pendente validação e publicação em produção`}</em></p>
        </blockquote></li>
      <li parentName="ol"><del parentName="li">{`Atualizar dados Raio-x para Agosto/20 (até onde der)`}</del><blockquote parentName="li">
          <p parentName="blockquote"><em parentName="p">{`Faltou atualização dos dados de Custeio`}</em></p>
        </blockquote></li>
      <li parentName="ol"><del parentName="li">{`Assimilar as DAGs da DELOG (dev da ENAP) - `}{`[3 de 10 DAGs]`}</del><blockquote parentName="li">
          <p parentName="blockquote"><em parentName="p">{`Finalizando DAG sancoesMG_dag`}</em></p>
        </blockquote></li>
      <li parentName="ol"><del parentName="li">{`(CONCLUIR) Reescrever carga do Orçamento via extração TG`}</del></li>
      <li parentName="ol"><del parentName="li">{`Realizar repasse de conhecimento sobre Airflow (DAG Covid19) para DELOG`}</del><blockquote parentName="li">
          <p parentName="blockquote"><em parentName="p">{`Aguardando momento da DELOG para repasse de conhecimento`}</em></p>
        </blockquote></li>
      <li parentName="ol"><del parentName="li">{`Disponibilizar Dados Abertos Automatizados Raio-x - Parte 2 de 2`}</del><blockquote parentName="li">
          <p parentName="blockquote"><em parentName="p">{`Pendente validar descrições e publicar e extrair ocupação de cargos`}</em></p>
        </blockquote></li>
      <li parentName="ol">{`[API SIORG - Swagger]`}{` - Estudo técnico/negocial de melhorias`}</li>
      <li parentName="ol"><del parentName="li">{`[Cinedados]`}{` Assistir 1 filme coletivamente`}</del><blockquote parentName="li">
          <p parentName="blockquote"><em parentName="p">{`Bladerunner 2049 em 18-09-2020 às 15:30`}</em></p>
        </blockquote></li>
      <li parentName="ol">{`(CONCLUIR) `}{`[DAGs]`}{` Incluir README documentando as dags em cada projeto`}<blockquote parentName="li">
          <p parentName="blockquote"><em parentName="p">{`Ainda em execução`}</em></p>
        </blockquote></li>
      <li parentName="ol"><del parentName="li">{`Evoluir deploy container Airflow `}{`[rever arquitetura, colocar na esturura do Rancher]`}</del><blockquote parentName="li">
          <p parentName="blockquote"><em parentName="p">{`Falta concluir a migração e desligar o antigo`}</em></p>
        </blockquote></li>
      <li parentName="ol"><del parentName="li">{`[DM SIORG]`}{` - Apresentação do Status atual e Refatorar/Ajustar modelo`}</del></li>
      <li parentName="ol"><del parentName="li">{`Apoiar DTI na implantação do portal de dados abertos do ME`}</del></li>
    </ol>
    <p><strong parentName="p">{`Histórias desejáveis`}</strong></p>
    <ul>
      <li parentName="ul">{`Resolver Backups das nossas aplicações`}</li>
      <li parentName="ul">{`Criar texto de missão/visão da nossa equipe`}<blockquote parentName="li">
          <p parentName="blockquote">{`Vamos criar o propósito, conforme essa orientação `}<a parentName="p" {...{
              "href": "https://targetteal.com/en/blog/throw-away-vision-mission-create-purpose/"
            }}>{`aqui`}</a></p>
        </blockquote></li>
    </ul>
    <h2 {...{
      "id": "encerramento"
    }}>{`Encerramento`}</h2>
    <p>{`😍🤖🛸`}</p>
    <p><img alt={"img"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./../../static/img/encerramento-sprint-12.png").default} /></p>
    <h2 {...{
      "id": "links"
    }}>{`Links`}</h2>
    <p><a parentName="p" {...{
        "href": "https://docs.google.com/spreadsheets/d/1mvhFxE6dZfE3yS-29vS5D7n_SXEgsrNWzNnNRXVrmVY/edit#gid=304103167"
      }}>{`Cronograma completo`}</a></p>
    <p><a parentName="p" {...{
        "href": "https://docs.google.com/spreadsheets/d/1awkLIhQmo0le-exMgK1xqtgGRBWftqMg2IQCtx6bfLU/edit#gid=1119539788&fvid=1174388734"
      }}>{`Acompanhamento Gabinete`}</a></p>
